function getSvtC(sid) {
    let svt = mstSvtTotalSkillDetail[sid].classPassive;
    let a = {};
    for (key in svt) {
        let num = svt[key];
        a[num] = mstSvtClassSkill[num]
    }
    return a;
}

function getSvtS(sid) {
    return mstSvtTotalSkillDetail[sid];
}

function getSvtSkill(sid) {
    let a = getSvtC(sid);
    let b = getSvtS(sid);
    let result = {
        'activity':b.activity,
        'classPassive':a,
        'treasure':b.treasure
    }
    return result;
}